import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css'
import React from 'react';
import withFirebaseAuth from 'react-with-firebase-auth';
import * as firebase from 'firebase/app';
import 'firebase/auth';
import Config from '../firebaseConfig';
import Login from './login.jsx';
import Banner from './banner.jsx';

//Bootstrap Imports
import Navbar from 'react-bootstrap/Navbar'



const firebaseAppAuth = Config.auth();

const providers = {
  googleProvider: new firebase.auth.GoogleAuthProvider(),
};

class Welcome extends React.Component {

render () {
return (
    <div>
      <header className="App-header">
        <Login 
         user={this.props.user}
         signInWithGoogle={this.props.signInWithGoogle}
         signOut={this.props.signOut}/> 
         <Banner />
      </header>

      <table id="welcomeTable">
        <tr>
        <td>
        <h2>In Need of a Lawyer?</h2>
        <p>Click the button below to visit our form that makes it easy to get in touch with a lawyer:</p>
        <button><a href="/contact-a-lawyer">Contact a Lawyer!</a></button>
        </td>
        <td>
        <h2>Need to check your prospects?</h2>
        <p>Sign in and then visit your dashboard by clicking the button below:</p>
        <button><a href="/prospects">See My Prospects</a></button>
        </td>
      </tr>
      </table>
      </div>
)}};

export default withFirebaseAuth({
    providers,
    firebaseAppAuth,
})(Welcome);
